import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { createSpinner, showSpinner, hideSpinner } from '@syncfusion/ej2-popups';
import { SampleBase } from '../common/sample-base';
import { DocumentEditorContainerComponent, Toolbar } from '@syncfusion/ej2-react-documenteditor';
import { TitleBar } from './title-bar';
import './default.component.css';
import { DropDownButton } from '@syncfusion/ej2-react-splitbuttons';
import { ListView } from '@syncfusion/ej2-react-lists';
DocumentEditorContainerComponent.Inject(Toolbar);

// tslint:disable:max-line-length
export class Export extends SampleBase<{}, {}> {
    private hostUrl: string = 'https://services.syncfusion.com/react/production/api/documenteditor/';
    public container: DocumentEditorContainerComponent;
    public titleBar: TitleBar;

    public toolbarOptions: any = [
        'New',
        'Open',
        {
            tooltipText: 'Export',
            template:
                '<button title="Export" class="e-tbar-btn e-tbtn-txt e-control e-btn e-lib e-dropdown-btn e-caret-hide" type="button" id="dropdownbtn"><span class="e-btn-icon e-icons e-export e-icon-left"></span><span class="e-tbar-btn-text">' +
                'Export' +
                '</span><span class="e-btn-icon e-icons e-icon-right e-caret"></span></button><div id="listview"></div>',
            id: 'dropdownbtn',
            text: 'Export',
        },
        'Separator',
        'Undo',
        'Redo',
        'Separator',
        'Separator',
        'Image',
        'Table',
        'Hyperlink',
        'Bookmark',
        'TableOfContents',
        'Separator',
        'Header',
        'Footer',
        'PageSetup',
        'PageNumber',
        'Break',
        'Separator',
        'Find',
        'Separator',
        'Comments',
        'TrackChanges',
        'Separator',
        'LocalClipboard',
        'Separator',
        'FormFields',
        'UpdateFields',
    ];


    public rendereComplete(): void {
        window.onbeforeunload = function () {
            return 'Want to save your changes?';
        }
        this.container.documentEditor.pageOutline = '#E0E0E0';
        this.container.documentEditor.acceptTab = true;
        this.container.documentEditor.resize();
        this.titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), this.container.documentEditor, true);
        this.onLoadDefault();
    }
    render() {
        return (<div className='control-pane'>
            <div className='control-section'>
                <div id='documenteditor_titlebar' className="e-de-ctn-title"></div>
                <div id="documenteditor_container_body">
                    <DocumentEditorContainerComponent id="container" ref={(scope) => { this.container = scope; }} style={{ 'display': 'block' }}
                        height={'590px'} serviceUrl={this.hostUrl} enableToolbar={true} toolbarItems={this.toolbarOptions} locale='en-US' />
                </div>
            </div>
            <div id="action-description">
                <p>This example illustrates how to efficiently export a document to various formats using the DocumentEditor. You can seamlessly convert your content into formats such as PDF, RTF, HTML, ODT, WordML, Plain Text, Word Template, and Markdown.</p>
            </div>
            <div id="description">
                <p>In this example, Document Editor provides exporting of the document as follows</p>
                <p style={{ "display": "block" }}>Client-side exporting</p>
                <ul>
                <li>Syncfusion Document Text (*.sfdt)</li>
                    <li>Word Document (*.docx)</li>
                    <li>Word Template (*.dotx)</li>
                    <li>Plain Text (*.txt)</li>
                </ul>
                <p style={{ "display": "block" }}>Server-side exporting</p>
                <ul>
                    <li>PDF (*.pdf)</li>
                    <li>HyperText Markup Language (*.html)</li>
                    <li>Rich Text Format (*.rtf)</li>
                    <li>Markdown (*.md)</li>
                    <li>OpenDocument Text (*.odt)</li>
                </ul>
                <p style={{ 'display': 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/">documentation section.</a>
                </p>
            </div>
        </div>);
    }
    onLoadDefault = (): void => {
        // tslint:disable
        let defaultDocument: object = { "sfdt": "" };

        let dataSource = [
            {
                class: 'data',
                text: 'Word Document (*.docx)',
                id: 'docx',
                category: 'Client side exporting',
            },
            {
                class: 'data',
                text: 'Syncfusion Document Text (*.sfdt)',
                id: 'sfdt',
                category: 'Client side exporting',
            },
            {
                class: 'data',
                text: 'Plain Text (*.txt)',
                id: 'text',
                category: 'Client side exporting',
            },
            {
                class: 'data',
                text: 'Word Template (*.dotx)',
                id: 'dotx',
                category: 'Client side exporting',
            },
            {
                class: 'data',
                text: 'PDF (*.pdf)',
                id: 'pdf',
                category: 'Server side exporting',
            },
            {
                class: 'data',
                text: 'HyperText Markup Language (*.html)',
                id: 'html',
                category: 'Server side exporting',
            },
            {
                class: 'data',
                text: 'OpenDocument Text (*.odt)',
                id: 'odt',
                category: 'Server side exporting',
            },
            {
                class: 'data',
                text: 'Markdown (*.md)',
                id: 'md',
                category: 'Server side exporting',
            },
            {
                class: 'data',
                text: 'Rich Text Format (*.rtf)',
                id: 'rtf',
                category: 'Server side exporting',
            },
            {
                class: 'data',
                text: 'Word XML Document (*.xml)',
                id: 'wordml',
                category: 'Server side exporting',
            },
        ];

        let ddbOption = {
            target: '#listview',
            cssClass: 'e-caret-hide',
        };

        let drpDownBtn = new DropDownButton(ddbOption);

        let listviewInstance = new ListView({
            dataSource: dataSource,
            // Map the appropriate columns to fields property
            fields: { text: 'text', groupBy: 'category' },
            select: change.bind(this),
        });
        const element:any = document.getElementById('container');
        function change(args) {
            var value = args.data.id;
            switch (value) {
                case 'docx':
                    this.container.documentEditor.save("Sample", 'Docx');
                    break;
                case 'sfdt':
                    this.container.documentEditor.save("Sample", 'Sfdt');
                    break;
                case 'text':
                    this.container.documentEditor.save("Sample", 'Txt');
                    break;
                case 'dotx':
                    this.container.documentEditor.save("Sample", 'Dotx');
                    break;
                case 'pdf':
                    formatSave('Pdf');
                    break;
                case 'html':
                    formatSave('Html');
                    break;
                case 'odt':
                    formatSave('Odt');
                    break;
                case 'md':
                    formatSave('Md');
                    break;
                case 'rtf':
                    formatSave('Rtf');
                    break;
                case 'wordml':
                    formatSave('Xml');
                    break;
            }
            args.item.classList.remove('e-active');
        }

        function formatSave(type) {
            createSpinner({
                target: element,
            });
            showSpinner(element);
            let format = type;
            let url = this.container.documentEditor.serviceUrl + 'Export';
            let fileName = this.container.documentEditor.documentName;
            let http = new XMLHttpRequest();
            http.open('POST', url);
            http.setRequestHeader('Content-Type', 'application/json;charset=UTF-8');
            // Set the responseType to 'blob' to handle binary data
            http.responseType = 'blob'; 

            // Prepare data to send
            let sfdt = {
                Content: this.container.documentEditor.serialize(),
                Filename: fileName,
                Format: '.' + format
            };

            // Set up event listener for the response
            http.onload = function () {
                if (http.status === 200) {
                    // Handle the response blob here
                    let responseData = http.response;

                    // Create a Blob URL for the response data
                    let blobUrl = URL.createObjectURL(responseData);

                    // Create a link element and trigger the download
                    let downloadLink = document.createElement('a');
                    downloadLink.href = blobUrl;
                    downloadLink.download = fileName + '.' + (format).toLowerCase();
                    document.body.appendChild(downloadLink);
                    hideSpinner(element);
                    downloadLink.click();

                    // Cleanup: Remove the link and revoke the Blob URL
                    document.body.removeChild(downloadLink);
                    URL.revokeObjectURL(blobUrl);
                } else {
                    // Handle errors
                    console.error('Request failed with status:', http.status);
                    hideSpinner(element);
                }
            };

            // Send the request with JSON.stringify(sfdt) as the request body
            http.send(JSON.stringify(sfdt));
        }

            // tslint:enable        
            this.container.documentEditor.open(JSON.stringify(defaultDocument));
            this.container.documentEditor.documentName = 'Getting Started';
            this.titleBar.updateDocumentTitle();
            this.container.documentEditor.documentEditorSettings.showRuler = true;
            drpDownBtn.appendTo('#dropdownbtn');
            listviewInstance.appendTo('#listview');
            this.container.documentChange = (): void => {
                this.titleBar.updateDocumentTitle();
                this.container.documentEditor.focusIn();
            };
        
    }
}